import React from 'react'
import Rating from '../../../Rating/Rating.js';
import '../../../Product/Product.css';
export default function MenShirts(props) {
    const {products} = props;
    return (
       <div key= {products._id} className="pCard">
  <a href={`/product/${products._id}`}>
    <img className ="medium" src={products.image} alt={products.name}/>
    </a>
    <div className= "pCard-body">
      <a href={`/product/${products._id}`}><h2> {products.name}</h2></a>
      <Rating rating={products.rating} numReviews = {products.numReviews}></Rating>
      <div className="price">
      Rs. {products.price}
      </div>
    </div>
  </div>
    )
}
